export default (function(a,b,c,d,e,f){return {data:{rn8sgqlPb8:{data:{id:440,attributes:{imdbId:"tt0051437",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTE5MWE0YTAtNTFjNi00OGQ4LWFlZDgtNWI5NjY4NWUwMjZjXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"}],item_lang:{data:{id:1103,attributes:{title:"Buchanan Rides Alone",plot:"On his way home to West Texas, Tom Buchanan rides into the Californian border town of Agry, and into a feud between several members of the Agry family. In helping out a Mexican seeking revenge on one of them, Buchanan finds himself against the whole family.",slug:"buchanan-rides-alone"}}},books:{data:[{id:3558,attributes:{title:d,description:"He was a tall son—taller than most men by a head, with a look of wildness in his battered, tough face. He was Tom Buchanan out of West Texas, who fought with joy and loved with gusto—who many times had gone to meet death without pause and with great good nature. This time he took on the whole of Agry County and the violent bandit clan that ran it. It was no fight of his—but a girl had been violated and a family’s honor tarnished. So Buchanan settled his gunbelt and flexed his great hands and went surging into battle like a one-man troop of cavalry. And, by God, in the end there was left even to burn in Agrytown …",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_xbsDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:e,publisher:f,subtitle:a}},{id:3559,attributes:{title:d,description:a,thumbnail:a,authors:[b],firstBook:c,published:"1956-01-01",publisher:a,subtitle:a}},{id:3560,attributes:{title:"Buchanan's Revenge: And, The Name's",description:a,thumbnail:a,authors:[b],firstBook:c,published:"1985-01-01",publisher:a,subtitle:"Buchanan"}},{id:3561,attributes:{title:"Buchanan's Revenge",description:"They said in Texas that Tom Buchanan ate wildcat for breakfast and that he was slow to anger—like a rattler dozing in the desert sun. But now every saloon and dance hall had heard the news: Buchanan was cleaning his guns. The genial giant of a man had sworn to kill the outlaws who had shot his best friend in the back. Old timers shook their heads. It wasn’t going to be a fair fight, they said. The odds were only three to one.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ijztDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:e,publisher:f,subtitle:a}},{id:3562,attributes:{title:"The Name's Buchanan, Etc. [A Novel.].",description:a,thumbnail:a,authors:[b],firstBook:c,published:"1958-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940933861}}("","Jonas Ward",null,"The Name's Buchanan","2012-06-03","Simon and Schuster"))